INSERT INTO `vacations` (`vacationID`, `description`, `destination`, `image`, `startDate`, `endDate`, `price`) VALUES
(1, 'Rome is the capital city and a special comune of Italy. Rome also serves as the capital of the Lazio region. With 2,872,800 residents in 1,285 km, it is also the countrys most populated comune. It is the fourth most populous city in the European Union by population within city limits.', 'Italy : Rome', '562c913a-4e1b-4e54-b3e2-d3087864ee88', '2020-07-19', '2020-07-24', '1000'),
(2, 'Salar de Uyuni (or Salar de Tunupa) is the worlds largest salt flat, at 10,582 square kilometers (4,086 sq mi). It is in the Daniel Campos Province in Potos in southwest Bolivia, near the crest of the Andes at an elevation of 3,656 meters (11,995 ft) above sea level.', 'Bolivia : Salar de Uyuni ', 'photo-1526029655228-b7ee496c7819', '2020-07-01', '2020-07-24', '1300'),
(3, 'London, the capital of England and the United Kingdom, is a 21st-century city with history stretching back to Roman times. At its centre stand the imposing Houses of Parliament, the iconic Big Ben clock tower and Westminster Abbey, site of British monarch coronations. ', 'United Kingdom : London ', 'd18e7df2-084d-4d6b-9c89-1d6ff5dc7243', '2020-02-18', '2020-04-13', '1300'),
(4, 'Sydney is the state capital of New South Wales and the most populous city in Australia and Oceania. Located on Australia east coast, the metropolis surrounds Port Jackson and extends about 70 km', 'Sydney : Australia', 'c2608bc9-8037-4117-b455-9a569590439d', '2020-01-18', '2020-03-28', '1100'),
(5, 'Officially the highest country on Earth, lofty Nepal is commonly referred to as the \"roof of the world\" That seems like a fitting moniker for this Himalayan nation, where soaring, snow-capped mountains disappear into the clouds like stairways to heaven.', 'Nepal : Reach To Haven', 'photo-1503641926155-5c17619b79d0', '2020-07-19', '2020-07-24', '1000'),
(6, 'Mount Fuji is located on Honsh, is the highest volcano in Japan at 3,776.24 m (12,389 ft), 2nd-highest volcano of an island in Asia (after Mount Kerinci in Sumatra), and 7th-highest peak of an island in the world. It is an active stratovolcano that last erupted in 17071708. Mount Fuji lies about 100 kilometers (60 mi) south-west of Tokyo, and can be seen from there on a clear day. ', 'Japan : Mount Fuji', 'photo-1528164344705-47542687000d', '2020-02-18', '2020-04-13', '1500'),
(7, 'Paris is the capital and most populous city of France, with a population of 2,148,271 residents (official estimate, 1 January 2020) in an area of 105 square kilometres (41 square miles).merce, fashion, science and arts.', 'Paris:  France', 'c7d6e96a-ec58-46be-8236-31cb88f93c4d', '2018-03-11', '2018-05-11', '1200'),
(8, 'Agra is a city on the banks of the Yamuna river in the Indian state of Uttar Pradesh.[9] It is 206 kilometres (128 mi) south of the national capital New Delhi. Agra is the fourth-most populous city in Uttar Pradesh and 24th in India', 'India : Agra ', '1e0cbb49-c7e7-4679-b94d-cd2fc6d835e2', '2020-07-01', '2020-07-25', '1200'),
(9, 'Machu Picchu is a 15th-century Inca citadel, located in the Eastern Cordillera of southern Peru, on a 2,430-metre (7,970 ft) mountain ridge. It is located in the Cusco Region, Urubamba Province, Machupicchu District, above the Sacred Valley, which is 80 kilometres (50 mi) northwest of Cuzco. ', 'Peru : Explore the Ancint Maya', 'photo-1534615098829-958121bcc188', '2020-01-18', '2020-01-27', '1550'),
(10, 'Santiago, llamada tambin Santiago de Chile, es la capital de Chile. Es adems una de las seis provincias que conforman la Regin Metropolitana de Santiago. Situada a orillas del ro Mapocho, Santiago fue fundada por el conquistador espaol Pedro de Valdivia, bajo el nombre de Santiago de Nueva Extremadura, en el siglo XVI. ', 'Chila : Santiago de Chile', 'photo-1521058798685-39dd95c33314', '2018-09-04', '2018-12-17', '1500'),
(11, 'he Carnival of Brazil is an annual Brazilian festival held between the Friday afternoon before Ash Wednesday and Ash Wednesday at noon, which marks the beginning of Lent, the forty-day period before Easter. During ', 'Brazil : Rio de Janeiro ', 'dc7b9102-d292-42c7-a04a-e43ab336f765', '2019-09-03', '2019-09-09', '1500'),
(12, 'Bagan (formerly Pagan) is an ancient city and a UNESCO World Heritage Site located in the Mandalay Region of Myanmar. From the 9th to 13th centuries, the city was the capital of the e Pagan Kingdom, the first kingdom that unified the regions that would later constitute modern Myanmar', 'Temples of Bagan : Myanmar', '14ae8fca-e80d-40eb-a892-b423ac69d326', '2020-02-18', '2020-05-21', '500'),
(13, 'The Democratic Republic of the Congo also known as DR Congo, the DRC, DROC, Congo-Kinshasa, or simply the Congo, is a country located in Central Africa. It was formerly called Zaire (19711997', 'Democratic Republic of the Congo', 'photo-1579547056948-3bc828faf558', '2020-01-18', '2020-01-28', '1500'),
(14, 'The Serengeti National Park is a Tanzanian national park in the Serengeti ecosystem in the Mara and Simiyu regions. It is famous for its annual migration of over 1.5 million white-bearded (or brindled) wildebeest and 250,000 zebra and for its numerous Nile crocodile and honey badger.', 'Tanzania : Serengeti National Park ', 'b1ecaec4-01fd-45ec-8118-6a3519d380f1', '2020-07-19', '2020-07-24', '1000'),
(15, 'The Valley of the Kings also known as the Valley of the Gates of the is a valley in Egypt where, for a period of nearly 500 years from the 16th to 11th century BC, rock cut tombs were excavated for the pharaohs and powerful nobles of the New Kingdom (the Eighteenth to the Twentieth Dynasties of Ancient Egypt)', 'Egypt :  Valley of the Kings', '40d5ac7d-5516-4ca7-ac2a-4917e9924217', '2020-02-18', '2020-04-13', '500'),
(16, 'The Forbidden City is a palace complex in central Beijing, China. It houses the Palace Museum, and was the former Chinese imperial palace from the Ming dynasty (since the Yongle Emperor) to the end of the Qing dynasty (since the Shunzhi Emperor) (the years 1420 to 1912).', 'China :  Forbidden City', 'a0ce565f-c375-4a94-8f56-60fd4e879000', '2020-01-18', '2020-01-28', '1500'),
(17, 'Ongi Monastery (Mongolian:  , Ongiin Khiid) is the collective name for the ruins of two monasteries that face each other across the Ongi River in Saikhan-Ovoo district of Dundgovi Province, in south-central Mongolia. The Barlim Monastery is located on the north bank of the river while the Khutagt Monastery sits on the south bank. The older southern complex consisted of various ', 'Mongolia : Ongiin Khiid ', '6b86b260-d6bf-440f-b27a-67bb348c7ffa', '2020-01-18', '2020-01-28', '1000'),
(18, 'San Francisco, is the cultural, commercial, and financial center of Northern California. San Francisco is the 12th-largest metropolitan statistical area in the United States by population, with 4.7 million people.', 'San Francisco : California', 'photo-1501594907352-04cda38ebc29', '2020-07-19', '2020-07-24', '1000'),
(19, 'Whether you are a hardcore adrenaline junkie, a wildlife enthusiast or a city slicker looking for cutting-edge culture, Canada ticks all the boxes.', 'Canda : Country of Maypel', 'photo-1508693926297-1d61ee3df82a', '2020-02-18', '2020-04-13', '1500'),
(20, 'Antarctica  Earth southernmost continent. It contains the geographic South Pole and is situated in the Antarctic region of the Southern Hemisphere, almost entirely south of the Antarctic Circle, and is surrounded by the Southern Ocean. At 14,200,000 square kilometres (5,500,000 square miles), it is the fifth-largest continent and nearly.', 'Antarctica : Frozen World', '0cbaf7f8-4fb1-45ee-8bf6-543cc5243a23', '2020-02-18', '2020-04-13', '500'),
(22, 'Tierra del Fuego (Spanish for \"Land of Fire\", formerly also Fireland in English) is an archipelago off the southernmost tip of the South American mainland, across the Strait of Magellan. The archipelago consists of the main island, Isla Grande de Tierra del Fuego, with an area of 48,100 km2 (18,572 sq mi), and a group of many islands, including Cape Horn and Diego Ramrez Islands. ', 'Argentine : Tierra del Fuego', 'photo-1504916390926-051aa60f206f', '2020-01-18', '2020-01-28', '1500'),
(23, 'Mexico City, or the City of Mexico. Nahuatl languages: lteptl Mxihco), is Mexico\'s capital city, one of the 31 states which make up the 32 Federal Entities of Mexico. It is also the capital of Mexico and the most populous city in North America. Mexico City is one of the most important cultural and financial centres in the world.] It is located in the Valley of Mexico (Valle de Mxico), a large valley in the high plateaus in the center of Mexico, at an altitude of 2,240 meters (7,350 ft). The city has 16 alcaldas, formerly known as boroughs.', 'Mecixo City : Mexico', 'photo-1512813195386-6cf811ad3542', '2020-07-19', '2020-07-24', '1100'),
(31, 'Scotland  is a country that is part of the United Kingdom. It covers the northern third of the island of Great Britain,with a border with England to the southeast, and is surrounded by the Atlantic Ocean to the north and west, the North Sea to the northeast, the Irish Sea to the south, and more than 790 islands including the Northern Isles and the Hebrides.', 'Scotland : Glasgow', '55da95ff-75da-48cc-b9e0-92448031c972', '2020-03-22', '2020-03-26', '1200'),
(32, 'Holi ( /holi/) is a popular ancient Hindu festival, originating from the Indian subcontinent. It is celebrated predominantly in North India, but has also spread to other areas of Asia and parts of the Western world through the diaspora from the Indian subcontinent. Holi is popularly known as the Indian \"festival of spring\", the \"festival of colours\", or the \"festival of love\". The festival signifies the victory of good over evil', 'India ', '353ee47d-d5c1-4c88-9a87-3b8e7c418c39', '2019-08-04', '2019-09-18', '900'),
(33, 'Thailand officially the Kingdom of Thailand and formerly known as Siam is a country at the Southeast Asian Indochinese Peninsula composed of 76 provinces. Clockwise from northwest, Thailand is bordered by Myanmar, Laos, Cambodia, the Gulf of Thailand, Malaysia and the Andaman Sea. Nominally a constitutional monarchy and parliamentary democracy since 1932, the coup in 2014 established a de facto military dictatorship under a junta.', 'Thailand', 'ed928eae-7eb4-4288-89e9-96a70dddcf2d', '2020-03-17', '2020-03-18', '1000'),
(34, 'Holland is a region and former province on the western coast of the Netherlands. The name Holland is also frequently used informally to refer to the whole of the country of the Netherlands. This usage is commonly accepted in other countries, and sometimes employed by the Dutch themselves. However, some in the Netherlands, particularly those from regions outside Holland, may find it undesirable or misrepresentative to use the term for the whole country.', 'Holand', 'a73186d7-e562-46e4-b272-ba2f256b0f23', '2020-03-01', '2020-03-28', '1300'),
(35, 'The Hobbit', 'New Zealand', '620d08bc-d2df-4b29-a519-d25bb58723c5', '2020-03-17', '2020-03-20', '1300'),
